import React from "react";

const Feature = ({
  title,
  subtitle,
  subtitleColor,
  content,
  image,
  reverse,
  roundedButton,
}) => {
  return (
    <div className="feature mt-[109px] px-4">
      <img src={image} alt="abc" />
      <div>
        <h4 class={`text-center ${subtitleColor}`}>{subtitle}</h4>
        <h2>{title}</h2>
        <p>{content}</p>
      </div>
    </div>
  );
};

export default Feature;
